sys_variable_value.value:
(function execute(inputs, outputs) {

  var inputs = new sn_sap_data_int.IntegrationsUtils().trimInputs(inputs);
  var jsonOut1 = inputs.json_string;
  var deli = inputs.delimiter;
  var parseOutput = new sn_sap_data_int.IntegrationsUtils().parseExecuteRFC(jsonOut1, deli);
  outputs.payment_terms = parseOutput.JSONOBJECT;
  outputs.total_rows = parseOutput.ROWCOUNT;

})(inputs, outputs);

